import React from 'react';
import Navigation from '../components/Navigation';

const Login = () => {
  return (
    <>
      <Navigation
        Title="Login"
        Links={[
          {
            title: 'Login',
            ref: '/login'
          }
        ]}
      />
    </>
  );
};

export default Login;
